import React, { Component } from 'react';

class PropsCompo2 extends Component {
    render() {
        const name = this.props.name;
        const age = this.props.age;
        const addr = this.props.addr;
        return (
            <div className="PropsCompo2">
                <em>PropsCompo2</em>
                이름 : {name}<br/>
                나이 : {age}<br/>
                주소 : {addr}<br/>
            </div>
        );
    }
}

export default PropsCompo2;
